import React, { useState } from 'react';

const handleDrop = (event, setParsedData, setIsJsonUploaded, setErrorMessage, setJobNumber) => {
  event.preventDefault();
  const file = event.dataTransfer.files[0];
  if (file && file.type === 'application/json') {
    //const jobNumber = file.name.split('.')[0]; // Extract job number from file name

    const reader = new FileReader();
    reader.onload = (e) => {
      try {
        const jsonString = e.target.result;
        const json = JSON.parse(jsonString);
        const jobNumber = json.name || "Default Job Name"; // Use 'Default Job Name' if no name field is found
        setJobNumber(jobNumber);

        // Determine if the file is structured with 'nodes' or 'connections'
        const isNodeStructure = !!json.nodes;
        const isConnectionStructure = !!json.connections;

        const data = [];
        const errors = [];

        if (isNodeStructure) {
          const nodes = json.nodes;
          Object.keys(nodes).forEach((nodeId) => {
            const node = nodes[nodeId];
            const attributes = node.attributes;

            try {
              const nodeType =
                attributes?.node_type?.["-Imported"] ||
                attributes?.node_type?.["multi_added"] ||
                attributes?.node_type?.["button_added"] ||
                "N/A";

              if (nodeType !== "pole") return;

              const poleCount =
                attributes?.pole_count?.["-Imported"] ||
                attributes?.pole_count?.["-Imported"] ||
              "N/A";
              const poleTag =
                attributes?.pole_tag?.["-Imported"]?.tagtext || "N/A";
              const constructionNotes =
                Object.values(attributes?.construction_notes || {})
                  .filter((note) => note.attacher === "Alabama Power")
                  .map((note) => note.note)
                  .join(", ") || "N/A";

              data.push({
                id: nodeId,
                type: nodeType,
                poleCount,
                poleTag,
                constructionNotes,
              });
            } catch (error) {
              errors.push(`Issue with attributes for node ID: ${nodeId}`);
              console.error(`Error processing node ID ${nodeId}:`, error);
            }
          });
        } else if (isConnectionStructure) {
          const connections = json.connections;
          Object.keys(connections).forEach((connectionId) => {
            const connection = connections[connectionId];
            const attributes = connection.attributes;

            try {
              const connectionType =
                attributes?.connection_type?.["button_added"] || "N/A";

              if (connectionType !== "aerial cable") return;

              const poleCount = attributes?.pole_count?.["-Imported"] || "N/A";
              const poleTag =
                attributes?.pole_tag?.["-Imported"]?.tagtext || "N/A";
              const constructionNotes =
                Object.values(attributes?.construction_notes || {})
                  .filter((note) => note.attacher === "Alabama Power")
                  .map((note) => note.note)
                  .join(", ") || "N/A";

              data.push({
                id: connectionId,
                type: connectionType,
                poleCount,
                poleTag,
                constructionNotes,
              });
            } catch (error) {
              errors.push(
                `Issue with attributes for connection ID: ${connectionId}`
              );
              console.error(
                `Error processing connection ID ${connectionId}:`,
                error
              );
            }
          });
        } else {
          setErrorMessage("Unrecognized JSON structure");
        }

        setParsedData(data);
        setErrorMessage(errors.join(" | "));
        setIsJsonUploaded(true);
      } catch (error) {
        console.error("Error parsing JSON", error);
        setErrorMessage("Error parsing JSON file.");
      }
    };
    reader.readAsText(file);
  }
};

function App() {
  const [parsedData, setParsedData] = useState([]);
  const [isJsonUploaded, setIsJsonUploaded] = useState(false);
  const [errorMessage, setErrorMessage] = useState('');
  const [jobNumber, setJobNumber] = useState('');

  return (
    <div className="min-h-screen flex flex-col">
      {/* Header */}
      <header className="bg-blue-600 text-white py-4 px-8 shadow-md">
        <h1 className="text-xl font-semibold">MMU JSON Parser</h1>
        {jobNumber && <h2 className="text-lg mt-2">Job Number: {jobNumber}</h2>}
      </header>

      <main className="flex-grow p-8 bg-gray-100">
        {errorMessage && (
          <div className="mb-4 p-4 bg-red-100 text-red-700 border border-red-400 rounded">
            {errorMessage}
          </div>
        )}

        {isJsonUploaded ? (
          <div className="text-gray-800">
            <h3 className="text-lg font-semibold mb-4">Job Data:</h3>
            <div className="bg-white border border-gray-300 rounded p-4">
              <div className="grid gap-4">
                {parsedData.map((item, index) => (
                  <div key={index} className="p-2 border-b border-gray-200">
                    <p><strong>ID:</strong> {item.id}</p>
                    <p><strong>Type:</strong> {item.type}</p>
                    <p><strong>Pole Count:</strong> {item.poleCount}</p>
                    <p><strong>Pole Tag:</strong> {item.poleTag}</p>
                    {item.constructionNotes && (
                      <p><strong>Construction Notes:</strong> {item.constructionNotes}</p>
                    )}
                  </div>
                ))}
              </div>
            </div>
          </div>
        ) : (
          <div
            onDragOver={(e) => e.preventDefault()}
            onDrop={(e) => handleDrop(e, setParsedData, setIsJsonUploaded, setErrorMessage, setJobNumber)}
            className="w-full h-48 border-4 border-dashed border-gray-300 flex items-center justify-center bg-white text-center cursor-pointer hover:border-gray-500 transition duration-300"
          >
            Drop your JSON file here
          </div>
        )}
      </main>
    </div>
  );
}

export default App;
